[{"header":{"type":"esummary","version":"0.3"},"result":{"uids":["5699","8138","19171"],"5699":{"uid":"5699","name":"PSMB10","description":"proteasome 20S subunit beta 10","status":"","currentid":"","chromosome":"16","geneticsource":"genomic","maplocation":"16q22.1","otheraliases":"IMD121, LMP10, MECL1, PRAAS5, beta2i","otherdesignations":"proteasome subunit beta type-10|low molecular mass protein 10|macropain subunit MECl-1|multicatalytic endopeptidase complex subunit MECl-1|proteasome (prosome, macropain) subunit, beta type, 10|proteasome MECl-1|proteasome catalytic subunit 2i|proteasome subunit MECL1|proteasome subunit beta 10|proteasome subunit beta 7i|proteasome subunit beta-2i|proteasome subunit beta2i","nomenclaturesymbol":"PSMB10","nomenclaturename":"proteasome 20S subunit beta 10","nomenclaturestatus":"Official","mim":["176847"],"genomicinfo":[{"chrloc":"16","chraccver":"NC_000016.10","chrstart":67936849,"chrstop":67934505,"exoncount":8}],"geneweight":2312,"summary":"The proteasome is a multicatalytic proteinase complex with a highly ordered ring-shaped 20S core structure. The core structure is composed of 4 rings of 28 non-identical subunits; 2 rings are composed of 7 alpha subunits and 2 rings are composed of 7 beta subunits. Proteasomes are distributed throughout eukaryotic cells at a high concentration and cleave peptides in an ATP/ubiquitin-dependent process in a non-lysosomal pathway. An essential function of a modified proteasome, the immunoproteasome, is the processing of class I MHC peptides. This gene encodes a member of the proteasome B-type family, also known as the T1B family, that is a 20S core beta subunit. Proteolytic processing is required to generate a mature subunit. Expression of this gene is induced by gamma interferon, and this gene product replaces catalytic subunit 2 (proteasome beta 7 subunit) in the immunoproteasome. [provided by RefSeq, Jul 2008]","chrsort":"16","chrstart":67934505,"organism":{"scientificname":"Homo sapiens","comm